def solution(stdin: str) -> str:
    n = int(stdin.readline().strip())
    arr = list(map(int, stdin.readline().strip().split(' ')))
    s = sum(arr)

    if s%n!=0:
        return str(-1)

    s = s//n
    dp = [[-1 for _ in range(s+1)] for _ in range(n)]

    def search(i: int, val: int, s: int) -> int:
        if i>=n:
            return 0

        if dp[i][s]!=-1:
            return dp[i][s]

        res = float('inf')
        if val + arr[i] <= s:
            res = min(res, search(i+1, arr[i], s-arr[i]))
        if val - arr[i] >= 0:
            res = min(res, search(i+1, arr[i], s-arr[i]))
        dp[i][s] = 1 + res
        return dp[i][s]

    return str(search(0, s, s))

