    # if we don't have at least N+1 shops
    if N < 1 or N > 100:
        return "no shop"
    open_and_close = []
    for _ in range(N):
        # open_and_close.append(stdin.split(" "))
        open_and_close.append(list(map(int, stdin.split())))
    # list of list with lists of the following format:
    # [shop_open, shop_close, day_open, day_close]
    shops = []
    for _ in range(5):
        shops.append([0, 0, 0, 0, 0])

    for i in range(N):
        for j in range(5):
            for k in range(2):
                if open_and_close[i][j * 2 + k] == 1:
                    shops[j][2 * k + 0] = 1
                    shops[j][2 * k + 1] = 0

    # for each day, we can either open or close the shop
    for day in range(5):
        # for each period
        for period in range(2):
            # if the shop is closed, we are not interested in it
            if shops[day][period] == 0:
                continue
            for day_next in range(5):
                # if the next day is the same, we are not interested
                if day_next == day:
                    continue
                for period_next in range(2):
                    # if the shop is closed on the next day, we are not interested
                    if shops[day_next][period_next] == 0:
                        continue
                    # we are interested if the shop is open on the next day
                    if shops[day_next][period_next] == 1:
                        # if the shop is open on the current day
                        if shops[day][period] == 1:
                            # if the shop is open on the next day, we are interested
                            if shops[day_next][period_next] == 1:
                                # we found the optimal solution
                                # so we can start looking for the next period
                                # and increase the number of open periods by one
                                return "yes"
    return "no"

