        stdin (str): Input given to the program.

    Returns:
        str: Output to be written to stdout.
    """
    # Attempt to parse the input into a list of integers.
    try:
        n = int(stdin)
        # For each queen we will store her position in the form of a tuple.
        queens = [
            (int(queen[0]), int(queen[1])) for queen in stdin.split()
        ]
    except:
        return "INCORRECT"

    # If the input is incorrect, then we can simply return "INCORRECT"
    if len(queens)!= n:
        return "INCORRECT"

    # Iterate over the queens and see if they can attack each other.
    for i in range(n):
        for j in range(i + 1, n):
            # If there is an attacking queen, then this is not a valid
            # solution.
            if queens[i] == queens[j]:
                return "INCORRECT"
            if abs(queens[i][0] - queens[j][0]) == abs(
                queens[i][1] - queens[j][1]
            ):
                return "INCORRECT"
    return "CORRECT"

